async function (divisionName) {
  if (divisionName == "") {
    await storeValue("positionOptions", [], true);
    return;
  }
  let positionList = appsmith.store.divisionList.filter(item => {
    return item.Division === divisionName;
  })[0].Position;
  await storeValue("positionOptions", PageLogic.MapSelectOptionList(positionList, "name"), true);
}
